     <h3 >الفاتوره</h3>
     <span style={{padding:100}}/>
     <img src="https://www.logodesign.net/logo/abstract-cuboid-building-4519ld.png" width={40} height={40} /> 

     </div>

    </div>
  );
}

export default InvoiceWeb;
